import React from 'react';
import Card from './Card'

const Cardlist = ({movies}) => {
    const CardArray = this.state.movies.map((movie, i) => {
        return <Card key={movie.id} movie={movie} />
    });
    return (
        <div>
            {CardArray}
        </div>
    )
}
export default Cardlist;
